protected NamedList getConfigSetFlags(CoreDescriptor cd, SolrResourceLoader loader) {
  if (loader instanceof ZkSolrResourceLoader) {
    try {
      return ConfigSetProperties.readFromResourceLoader(loader, ".");
    } catch (Exception ex) {
      return null;
    }
  } else {
    return null;
  }
}

